window.bookSummaryJSON = "<p><b>Paedyn and Kai are reunited but face a terrible decision in this thrilling conclusion to the </b><b><i>New York Times</i></b><b> bestselling romantasy trilogy perfect for fans of Sarah J. Maas and </b><b><i>The Red Queen</i></b><b>.</b></p> <p>Paedyn Gray and Kai Azer return to the Kingdom of Ilya…</p> <p>And Paedyn has a life-altering choice to make. Whatever she decides will determine her fate—and the fate of those around her—forever.</p> <p>In the ultimate battle of love and loyalty, who wins?</p>"; 
